CREATE TABLE IF NOT EXISTS "django_migrations" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app" varchar(255) NOT NULL, "name" varchar(255) NOT NULL, "applied" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_user_groups" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_user_user_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_content_type" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app_label" varchar(100) NOT NULL, "model" varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_permission" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "content_type_id" integer NOT NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "codename" varchar(100) NOT NULL, "name" varchar(255) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(150) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "auth_user" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "password" varchar(128) NOT NULL, "last_login" datetime NULL, "is_superuser" bool NOT NULL, "username" varchar(150) NOT NULL UNIQUE, "last_name" varchar(150) NOT NULL, "email" varchar(254) NOT NULL, "is_staff" bool NOT NULL, "is_active" bool NOT NULL, "date_joined" datetime NOT NULL, "first_name" varchar(150) NOT NULL);
CREATE TABLE IF NOT EXISTS "django_session" ("session_key" varchar(40) NOT NULL PRIMARY KEY, "session_data" text NOT NULL, "expire_date" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "request_town" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(150) NOT NULL, "municipality_id" bigint NOT NULL REFERENCES "request_municipality" ("id") DEFERRABLE INITIALLY DEFERRED, "slug" varchar(150) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "request_region" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(150) NOT NULL UNIQUE, "slug" varchar(150) NULL, "code" varchar(2) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "request_country" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(150) NOT NULL, "iso2" varchar(2) NOT NULL, "iso3" varchar(3) NOT NULL, "is_active" bool NOT NULL, "slug" varchar(150) NULL);
CREATE TABLE IF NOT EXISTS "request_municipality" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(150) NOT NULL, "slug" varchar(150) NOT NULL UNIQUE, "department_id" bigint NOT NULL REFERENCES "request_department" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "request_court" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(150) NOT NULL UNIQUE, "slug" varchar(50) NOT NULL UNIQUE, "type" varchar(150) NOT NULL, "description" text NULL, "department_id" bigint NULL REFERENCES "request_department" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "request_department" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(150) NOT NULL, "slug" varchar(150) NOT NULL UNIQUE, "region_id" bigint NOT NULL REFERENCES "request_region" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "request_payment" ("created_on" datetime NULL, "id" char(32) NOT NULL PRIMARY KEY, "request_code" varchar(24) NULL, "label" varchar(150) NULL, "amount" real NOT NULL, "pay_token" varchar(36) NULL, "operator_tx_id" varchar(50) NULL, "operator_user_id" varchar(50) NULL, "status" varchar(36) NOT NULL, "currency_code" varchar(5) NOT NULL, "mean" varchar(15) NULL, "message" varchar(255) NOT NULL, "updated_on" datetime NULL);
CREATE TABLE IF NOT EXISTS "django_rest_passwordreset_resetpasswordtoken" ("created_at" datetime NOT NULL, "key" varchar(64) NOT NULL UNIQUE, "ip_address" char(39) NULL, "user_agent" varchar(512) NOT NULL, "user_id" char(32) NOT NULL REFERENCES "request_agent" ("id") DEFERRABLE INITIALLY DEFERRED, "id" integer NOT NULL PRIMARY KEY AUTOINCREMENT);
CREATE TABLE IF NOT EXISTS "request_request" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "code" varchar(20) NOT NULL UNIQUE, "created_on" datetime NULL, "updated_on" datetime NULL, "status" varchar(15) NOT NULL, "user_first_name" varchar(150) NOT NULL, "user_last_name" varchar(150) NULL, "user_middle_name" varchar(150) NULL, "user_gender" varchar(6) NOT NULL, "user_birthday_certificate" varchar(100) NULL, "user_phone_number_1" varchar(15) NOT NULL, "user_phone_number_2" varchar(15) NULL, "user_whatsapp_number" varchar(15) NOT NULL, "user_email" varchar(150) NULL, "user_dob" date NULL, "user_residency_country_id" bigint NULL REFERENCES "request_country" ("id") DEFERRABLE INITIALLY DEFERRED, "user_nationality_id" bigint NULL REFERENCES "request_country" ("id") DEFERRABLE INITIALLY DEFERRED, "user_occupation" varchar(150) NULL, "user_marital_status" varchar(150) NULL, "has_stayed_in_cameroon" bool NOT NULL, "copy_count" integer unsigned NOT NULL CHECK ("copy_count" >= 0), "user_cob_id" bigint NULL REFERENCES "request_country" ("id") DEFERRABLE INITIALLY DEFERRED, "service_id" bigint NULL REFERENCES "request_service" ("id") DEFERRABLE INITIALLY DEFERRED, "amount" integer NULL, "purpose" text NULL, "user_residency_hood" varchar(150) NULL, "user_residency_municipality_id" bigint NULL REFERENCES "request_municipality" ("id") DEFERRABLE INITIALLY DEFERRED, "user_residency_town_id" bigint NULL REFERENCES "request_town" ("id") DEFERRABLE INITIALLY DEFERRED, "user_dpb_id" bigint NULL REFERENCES "request_department" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id_scan_1" varchar(100) NULL, "user_passport_1" varchar(100) NULL, "user_address" varchar(255) NULL, "user_id_scan_2" varchar(100) NULL, "user_passport_2" varchar(100) NULL, "proof_of_stay" varchar(100) NULL, "user_close_friend_number" varchar(15) NULL, "user_full_name" varchar(150) NOT NULL, "user_civility" varchar(15) NOT NULL, "user_postal_code" varchar(150) NULL, "user_birthday_certificate_url" varchar(250) NULL, "user_id_card_1_url" varchar(250) NULL, "user_id_card_2_url" varchar(250) NULL, "user_passport_1_url" varchar(250) NULL, "user_passport_2_url" varchar(250) NULL, "user_proof_of_stay_url" varchar(250) NULL, "user_wedding_certificate_url" varchar(250) NULL, "court_id" bigint NULL REFERENCES "request_court" ("id") DEFERRABLE INITIALLY DEFERRED, "destination_address" varchar(150) NOT NULL, "destination_location" varchar(150) NOT NULL, "agent_id" char(32) NULL REFERENCES "request_agent" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "authtoken_token" ("key" varchar(40) NOT NULL PRIMARY KEY, "created" datetime NOT NULL, "user_id" char(32) NOT NULL UNIQUE REFERENCES "request_agent" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "request_shipment" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "transport_company" varchar(150) NOT NULL, "agent_id" char(32) NULL REFERENCES "request_agent" ("id") DEFERRABLE INITIALLY DEFERRED, "request_id" bigint NOT NULL REFERENCES "request_request" ("id") DEFERRABLE INITIALLY DEFERRED, "created_on" datetime NULL, "destination_country_id" bigint NOT NULL REFERENCES "request_country" ("id") DEFERRABLE INITIALLY DEFERRED, "destination_hood" varchar(250) NULL, "destination_municipality_id" bigint NULL REFERENCES "request_municipality" ("id") DEFERRABLE INITIALLY DEFERRED, "destination_town_id" bigint NULL REFERENCES "request_town" ("id") DEFERRABLE INITIALLY DEFERRED, "status" varchar(150) NOT NULL, "updated_on" datetime NULL, "destination_address" varchar(150) NOT NULL, "destination_location" varchar(150) NOT NULL);
CREATE TABLE IF NOT EXISTS "request_agent_groups" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "agent_id" char(32) NOT NULL REFERENCES "request_agent" ("id") DEFERRABLE INITIALLY DEFERRED, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED);
