CREATE TABLE IF NOT EXISTS "request_agent_user_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "agent_id" char(32) NOT NULL REFERENCES "request_agent" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "request_trashmodel" ("created_on" datetime NULL, "updated_on" datetime NULL, "model_name" varchar(100) NOT NULL, "data" text NOT NULL CHECK ((JSON_VALID("data") OR "data" IS NULL)), "id" varchar(255) NOT NULL PRIMARY KEY);
CREATE TABLE IF NOT EXISTS "request_company" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(255) NOT NULL, "percentage" integer unsigned NOT NULL CHECK ("percentage" >= 0));
CREATE TABLE IF NOT EXISTS "request_disbursement" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "company_id" bigint NOT NULL REFERENCES "request_company" ("id") DEFERRABLE INITIALLY DEFERRED, "payment_id" char(32) NOT NULL REFERENCES "request_payment" ("id") DEFERRABLE INITIALLY DEFERRED, "created_on" datetime NULL, "updated_on" datetime NULL, "amount" real NOT NULL);
