CREATE TABLE IF NOT EXISTS "request_agent" ("id" char(32) NOT NULL PRIMARY KEY, "first_name" varchar(150) NOT NULL, "last_name" varchar(150) NOT NULL, "created_on" datetime NULL, "pending_task_count" integer NOT NULL, "updated_on" datetime NULL, "email" varchar(254) NOT NULL, "dob" date NULL, "gender" varchar(1) NOT NULL, "logo" varchar(100) NULL, "phone" text NOT NULL, "verify" bool NOT NULL, "date_joined" datetime NOT NULL, "is_active" bool NOT NULL, "is_staff" bool NOT NULL, "is_superuser" bool NOT NULL, "last_login" datetime NULL, "password" varchar(128) NOT NULL, "username" varchar(150) NOT NULL UNIQUE, "region_id" bigint NULL UNIQUE REFERENCES "request_region" ("id") DEFERRABLE INITIALLY DEFERRED, "is_csa" bool NOT NULL, "court_id" bigint NULL REFERENCES "request_court" ("id") DEFERRABLE INITIALLY DEFERRED);
